import './App.css';
import Container from './components/Container/Container';
import Header from './components/Header/Header';
import LoginButton from './components/LoginButton/LoginButton';
import Logo from './components/Logo/Logo';
import StreamerForm from './components/StreamerForm/SteamerForm';

function App() {
  return (
    <>
      <Header>
        <Container>
          <Logo />
          <LoginButton />
        </Container>
      </Header>
      <div style={{marginTop: '100px'}}><StreamerForm /></div>

    </>
  );
}

export default App;
